import styled from "styled-components";

const Container = styled.div`
  position: relative;
  top: 300px;
  display: flex;
  justify-content: center;
`;

const Paragraph = styled.h1`
  font-size: 20px;
`;

function Home() {
  return (
    <Container>
      <Paragraph>O que construímos</Paragraph>
      <p>
        Queremos que todos os profissionais de manutenção tenham acesso ao
        monitoramento online de equipamentos, e a uma plataforma “braço direito”
        que analisa, fornece insights valiosos, otimiza rotinas e permite tomada
        de decisões de forma prática e eficaz. Tudo isso só é possível
        combinando uma plataforma fácil de usar com um sensor IoT rápido de
        implementa
      </p>
    </Container>
  );
}

export default Home;
